import logo from './logo.svg';
import './App.css';
import React, { Component } from 'react';
import {
    BrowserRouter as Router,
    Routes,
    Route,
    useRoutes,
     Link } from "react-router-dom";
import IntroPage from './components/IntroPage/IntroPage'
import QuestionsPage from "./components/QuestionsPage/QuestionsPage";
import DatePage from "./components/DatePage/DatePage";
import CompletionPage from "./components/CompletionPage/CompletionPage";
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';

const routes = {
  "/": () => <IntroPage /> ,
  "/questions": () =>  <QuestionsPage /> ,
  "/date": () => <DatePage /> ,
  "/completion": () => <CompletionPage /> 
}

function App() {
  return (
      <Router>
        <Navbar bg="light" expand="lg">
          <Container>
            <Navbar.Brand href="/">React-Bootstrap</Navbar.Brand>
            <Navbar.Toggle aria-controls="basic-navbar-nav" />
            <Navbar.Collapse id="basic-navbar-nav">
              <Nav className="me-auto">
                <Nav.Link href="#home">Home</Nav.Link>
                <Nav.Link href="#link">Link</Nav.Link>
              </Nav>
            </Navbar.Collapse>
          </Container>
        </Navbar>
        <div>
          <Link to={'/'} >Intro</Link> 
          <br />
          <Link to={'/questions'} >Questions</Link> 
          <br />
          <Link to={'/date'}>Date</Link>
          <br />
          <Link to={'/completion'}>Completion</Link>
          <Routes>
            <Route exact path='/' element={<IntroPage/>} />
            <Route path='/questions' element={<QuestionsPage/>} />
            <Route path='/date' element={<DatePage/>} />
            <Route path='/completion' element={<DatePage/>} />
            </Routes>
        </div>
      </Router>
    );
  }

export default App;
